import LaunchesContainer from '../containers/LaunchesContainer';
import Layout from '../components/Layout';
import styled from 'styled-components';

const Title = styled.h1`
    font-size: 3rem;
    font-weight: bold;
    margin: 0 25px;
    color: white;
`;

const Header = styled.header`
    background-image: url('https://www.spacex.com/static/images/backgrounds/home_moon.webp');
    background-size: 150%;
    height: 70vh;
    background-position: center;
    width: 100%;
    padding-top: 100px;
`;

const Index = () => {
    return (
        <Layout>
            <Header>
                <Title className="">Past Launches</Title>
            </Header>
            <LaunchesContainer />
        </Layout>

    )
}



export default Index;
